import ScrollAnim from 'rc-scroll-anim';
import ReactDOM from 'react-dom';
import React from 'react';
import {
    HashRouter as Router,
    Route,
    Switch
} from 'react-router-dom';
import QueueAnim from 'rc-queue-anim';
import TweenOne from 'rc-tween-one';
import AriaModal from '../../react-aria-modal';
// import FocusTrap from 'focus-trap-react';
import content from './SectionsContent';
import {
    Contexto,
    datas
} from './SectionsContexto';
import Botao from './SectionsBotoes';
const FocusTrap = require('focus-trap-react');
// const AriaModal = require('../../react-aria-modal');
//ScrollAnim.scrollScreen.unMount({ });
const Link = ScrollAnim.Link;
const Element = ScrollAnim.Element;
const ScrollOverPack = ScrollAnim.OverPack;
const EventListener = ScrollAnim.Event;
const ScrollParallax = ScrollAnim.Parallax;

function find(id) {
    return content.find(p => p.id === id);
}

function Sections() {
    // this.state = {
    //   modalActive: false
    // };
    return ( < span > < Home / > < /span>)
    }

    function Toolbar(props) {
        return ( < Botao onClick = {
                props.changeContexto
            } > Change Theme < /Botao>);
        }
        class Home extends React.Component {
            // constructor(props) {
            //         super(props);
            //         this.state = {
            //           modalActive: false,
            //           data: datas.expandido,
            //         };
            //         this.toggleContexto = () => {
            //           this.setState(state => ({
            //             data:
            //               state.data === datas.dark
            //                 ? datas.expandido
            //                 : datas.collapsado,
            //           }));
            //         };
            // this.activateModal = this.activateModal.bind(this);
            // this.deactivateModal = this.deactivateModal.bind(this);
            // this.getApplicationNode = this.getApplicationNode.bind(this);
            //       }
            //       activateModal = () => {
            //         this.setState({ modalActive: true });
            //       };
            //       deactivateModal = () => {
            //         this.setState({ modalActive: false });
            //       };
            //       getApplicationNode = () => {
            //         return document.getElementById('application');
            //       };
            //       // find();
            constructor(props) {
                super(props);
                this.state = {
                    modalActive: false,
                };
                this.activateModal = this.activateModal.bind(this);
                this.deactivateModal = this.deactivateModal.bind(this);
                this.getApplicationNode = this.getApplicationNode.bind(this);
                this.activateInnerFocusTrap = this.activateInnerFocusTrap.bind(this);
                this.deactivateInnerFocusTrap = this.deactivateInnerFocusTrap.bind(this);
            }
            activateModal = () => {
                this.setState({
                    modalActive: true
                });
            };
            deactivateModal = () => {
                this.setState({
                    modalActive: false
                });
            };
            activateInnerFocusTrap() {
                this.setState({
                    innerFocusTrapActive: true
                });
            }
            deactivateInnerFocusTrap() {
                this.setState({
                    innerFocusTrapActive: false
                });
            }
            getApplicationNode() {
                return document.getElementById('application');
            }
            render() {
                return ( < div > < Intro match = {
                        {
                            params: {
                                id: 0
                            },
                            titulo: 'Intro'
                        }
                    }
                    /> {
                    content.map(i => ( < ScrollOverPack id = {
                            i.hash + i.id
                        }
                        className = {
                            i.classe + i.id
                        }
                        style = {
                            {
                                backgroundColor: i.bg,
                                'z-index': i.zindex
                            }
                        }
                        playScale = {
                            0.1
                        } > < TweenOne className = {
                            "tween-one conteudo-colapsado"
                        }
                        key = "0"
                        animation = {
                            {
                                delay: 200,
                                duration: 0,
                                translateY: 0,
                                opacity: 1
                            }
                        }
                        style = {
                            {
                                transform: 'translateY(0px)',
                                opacity: 0
                            }
                        } > < h2 > {
                            i.h2
                        } < /h2> <
                        div > {
                            i.descricao
                        } < /div> < AriaModal titleText = "demo four"
                        onExit = {
                            this.deactivateModal
                        }
                        // initialFocus = "#demo-four-deactivate"
                        focusDialog = {
                            false
                        }
                        mounted = {
                            this.state.modalActive
                        }
                        underlayStyle = {
                            {
                                paddingTop: '2em',
                                backgroundColor: '#f0f0f0',
                                height: '100vh'
                            }
                        } > < div id = "demo-four-modal"
                        className = "modal modal-animated"
                        style = {
                            {
                                background: '#dddddd'
                            }
                        } > < div className = "modal-body" > < button id = "demo-four-deactivate"
                        className = "ver_mais"
                        style = {
                            {
                                position: 'fixed',
                                top: '2em',
                                right: '1em',
                                background: 'transparent',
                                border: 0,
                                zIndex: 9999
                            }
                        }
                        onClick = {
                            this.deactivateModal
                        } > fechar < /button> <
